function CardLayout(props){

  return(
    <Col xs="3">

        {(props.props.category_title)}  {/* World */}

      <Card>
        <CardImg top width="100%" src={console.log("Hi.........")} alt={props.alt} />
        <CardBody>
            <CardTitle>{props.props.title}</CardTitle>
            {/* <CardSubtitle>Card subtitle</CardSubtitle> */}
            <CardText>
            {props.text}
          </CardText> 
        </CardBody>
      </Card>
    </Col>
  )
}
export default CardLayout;
